import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import uw from './images/W.png';

function UW() {
    return(
        <div className='App-header'>
            <img width='150' height='100' src={uw} style={{marginBottom: '0.5rem'}}></img>
        </div>
    );
}

export default UW;
